import React from 'react';

const FlagNg = props => (
  <svg viewBox="0 0 6 3" {...props}>
    <path fill="#008751" d="M0 0h6v3H0z" />
    <path fill="#FFF" d="M2 0h2v3H2z" />
  </svg>
);

export default FlagNg;
